import { Button } from '@material-ui/core';
import React, { useState, useEffect } from 'react';
import { UserLogin } from '../User/UserLogin';


export const UserUnknown = () => {

    const [register, setRegister] = useState(true);
    const [login, setLogin] = useState(true);

    const registerHandler = () => {
        setRegister(false)
    }

    const loginHandler = () => {
        setLogin(false)
    }



    return (
        <>
            <div className="user">
                <div className="userLogin">
                    <div className="loginDetails">
                        <span className="loginTitle">Bienvenido,
                            carnavalero</span>
                    </div>
                    {(login === true) ? <div className="loginSubtitle"><span>See all the new features we’ve added through our tutorial.</span>
                        <span>See all the new features we’ve added through our tutorial.</span></div> : <form className="loginForm">
                        <div className="loginInfo"><label>Username</label>
                            <input type="text" /></div>
                        <div className="loginInfo"><label>Email</label>
                            <input type="mail" /></div>
                    </form>}



                    <div className="loginButtons">

                        {login === true ? <Button onClick={registerHandler} variant="contained" color="primary">Registrarse</Button> : ""}
                        <Button onClick={loginHandler} variant="contained" color="primary">Iniciar sesión</Button></div>
                </div>
            </div>

        </>
    );
}
